import "./style.css";
import "./App.css";
import { effect } from "./animation";
import React, { useEffect, useLayoutEffect } from "react";
import Card from "./card";
import axios from "axios";

function App() {
  useLayoutEffect(effect, []);

  const url =
    "https://kobis.or.kr/kobisopenapi/webservice/rest/boxoffice/searchDailyBoxOfficeList.json?key=139c5c77da62dd7e6f039c1ce385dbe1&targetDt=20221217";

  async function getData() {
    try {
      const response = await axios.get(url);
      const data = response.data;
      console.log(data);
    } catch (error) {
      console.log(error);
    }
  }

  useEffect(() => {
    getData();
  }, []);

  return <></>;
}

export default App;
